    padding: 17,
    borderRadius: 30,
    margin: 10,
    marginLeft: 20,
    marginRight: 20,
}

class MakePlan extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    handleInputChange(event) {
        const target = event.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        const name = target.name;

        this.setState({
            [name]: value
        });
    }

    handleSubmit(event) {

